import React from 'react'

const buildResult = information => {
  return information.map(({ icon, iconColor, text }, index) => {
    return (
      <div className='column result-bar__information' key={index}>
        <i className={`mdi mdi-${icon} result-bar__icon ${iconColor}`} />
        {text}
      </div>
    )
  })
}

const ResultBar = props => {
  const { resultInformation } = props
  return (
    <div className='columns result-bar'>{buildResult(resultInformation)}</div>
  )
}

export default ResultBar
